(1, 'എഴുത്തച്ഛന്‍ അവാര്‍ഡും വയലാര്‍ അവാര്‍ഡും ലഭിച്ച എഴുത്തുകാരന്‍?', 1, 6, -1, -1, -1, '', 'എം.ടി.വാസുദേവന്‍ നായര്‍*ഒ.എന്‍.വി.കുറുപ്പ്*ശൂരനാട്ട് കുഞ്ഞന്‍പിള്ള*ഒ.വി.വിജയന്‍', 'ഒ.വി.വിജയന്‍', '4', 1, '', 1, -1, 1, 1, -1, 88, '2013-10-22 14:20:07'),
(2, 'അര+കല്ല്‌ അരകല്ല്, ഈ സന്ധിയില്‍ ''ക'' ഇരട്ടിക്കാത്തത്:', 1, 6, -1, -1, -1, '', 'വിശേഷണ വിശേഷ്യങ്ങള്‍ ഇല്ലാത്തതുകൊണ്ട്*ഉത്തരപാദാദിയിലെ വര്‍ണ്ണം ശിഥിലമായതുകൊണ്ട്*ഇടക്ക് സ്വരം വരുന്നത് കൊണ്ട്*പൂര്‍വപദം ധാതു ആയതുകൊണ്ട്', 'പൂര്‍വപദം ധാതു ആയതുകൊണ്ട്', '4', 1, '', 1, -1, 1, 1, -1, 84, NULL),
(3, 'ഇന്ത്യ സ്വാതന്ത്ര്യം നേടുമ്പോള്‍ കോണ്ഗ്രസ് പ്രസിഡന്റ് ആയിരുന്നത്..........ആണ്:', 1, 1, -1, -1, -1, '', 'നെഹ്‌റു*രാജേന്ദ്രപ്രസാദ്*സര്‍ദാര്‍ പട്ടേല്‍*ജെ.ബി.കൃപലാനി', 'ജെ.ബി.കൃപലാനി', '4', 1, '', 1, -1, 1, 1, -1, 45, NULL),
(4, 'Only......children like thrillers.', 1, 3, -1, -1, -1, '', 'few*the few*a few*a little', 'a few', '3', 1, '', 1, -1, 1, 1, -1, 62, NULL),
(5, 'വെയ്സ്റ്റ് ലാന്‍ഡ്‌ എഴുതിയത്......ആണ്', 1, 1, -1, -1, -1, '', 'സാമുവല്‍ ബെക്കറ്റ്*ടി.എസ്.എലിയറ്റ്*ടോള്‍സ്റ്റോയ്‌*ജെയിംസ്‌ ജോസ്', 'ടി.എസ്.എലിയറ്റ്', '2', 1, '', 1, -1, 1, 1, -1, 22, NULL),
(6, 'ഇറ്റാനഗര്‍......ന്‍റെ തലസ്ഥാനമാണ്‌', 1, 1, -1, -1, -1, '', 'മിസോറാം*സിക്കിം*ത്രിപുര*അരുണാചല്‍പ്രദേശ്‌', 'അരുണാചല്‍പ്രദേശ്‌', '4', 1, '', 1, -1, 1, 1, -1, 34, NULL),
(7, 'The adjective ''august'' means:', 1, 3, -1, -1, -1, '', 'rainy*serious*creating respect*proud', 'creating respect', '3', 1, '', 1, -1, 1, 1, -1, 65, NULL),
(8, 'ഗ്ലൂക്കോസ്........വിഭാഗത്തില്‍പ്പെടുന്നു', 1, 1, -1, -1, -1, '', 'കാര്‍ബോഹൈഡ്രേറ്റ്*ഫാറ്റ്*പ്രോട്ടീന്‍*വിറ്റമിന്‍', 'കാര്‍ബോഹൈഡ്രേറ്റ്', '1', 1, '', 1, -1, 1, 1, -1, 27, NULL),
(9, 'അവസാനത്തെ മുഗള്‍ രാജാവാണ്:', 1, 1, -1, -1, -1, '', 'ഷേര്‍ഷാ*ഷാ ആലം*ബഹദൂര്‍ഷാ സഫര്‍*മുഹമ്മദ്‌ ഷാ രംഗീല', 'ബഹദൂര്‍ഷാ സഫര്‍', '3', 1, '', 1, -1, 1, 1, -1, 48, NULL),
(10, 'He.......be very rich because he always travels First class.', 1, 3, -1, -1, -1, '', 'will*can*must*would', 'must', '3', 1, '', 1, -1, 1, 1, -1, 72, NULL),
(11, '....................ടെ പ്രവാഹമാണ് വൈദ്യുതി', 1, 1, -1, -1, -1, '', 'ഇലക്ട്രോണുകള്‍*മോളിക്യൂള്‍*ആറ്റം*ന്യുട്രോണുകള്‍', 'ഇലക്ട്രോണുകള്‍', '1', 1, '', 1, -1, 1, 1, -1, 26, NULL),
(12, 'There was.......ugly scar on his face.', 1, 3, -1, -1, -1, '', 'a*the*none of these*an', 'an', '4', 1, '', 1, -1, 1, 1, -1, 70, NULL),
(13, 'ഒരു മട്ടത്രികോണത്തിന്‍റെ വശങ്ങള്‍ a,a+d,a+2d,a-യും d-യും പോസിറ്റീവ് ആയാല്‍ a:d എന്ത്?', 1, 2, -1, -1, -1, '', '2:1*3:1*1:4*1:3', '3:1', '2', 1, '', 1, -1, 1, 1, -1, 5, NULL),
