(15, 'ഏറ്റവും വലിയ ഗ്രഹമാണ്;', 1, 1, -1, -1, -1, '', 'വ്യാഴം*ചൊവ്വ*ബുധന്‍*പ്ലൂട്ടോ', 'വ്യാഴം', '1', 1, '', 1, -1, 1, 1, -1, 28, NULL),
(16, 'ഭുകമ്പം രേഖപ്പെടുത്തുന്ന ഉപകരണമാണ്;', 1, 1, -1, -1, -1, '', 'സീസ്മോഗ്രാഫ്*പെരിസ്കോപ്പ്*ജൈറോസ്കോപ്പ്*സെക്സ്റ്റ്ന്റ്', 'സീസ്മോഗ്രാഫ്', '1', 1, '', 1, -1, 1, 1, -1, 23, NULL),
(17, 'A large crowd....expected at the function', 1, 3, -1, -1, -1, '', 'is*have*has*are', 'is', '1', 1, '', 1, -1, 1, 1, -1, 80, NULL),
(18, 'The children were warned.......', 1, 3, -1, -1, -1, '', 'for committing the mistake*with committing the mistake*against committing the mistake*to commit the mistake', 'against committing the mistake', '3', 1, '', 1, -1, 1, 1, -1, 78, NULL),
(19, '''കേരളീയര്‍'' എന്ന പദം ഏത് വിഭാഗത്തില്‍ പെടുന്നു', 1, 6, -1, -1, -1, '', 'നപുംസകലിംഗം*മൂന്നു വിഭാഗത്തിലും പെടും*പുല്ലിംഗം*അലിംഗം', 'അലിംഗം', '4', 1, '', 1, -1, 1, 1, -1, 86, NULL),
(20, 'അക്ഷരങ്ങള്‍ക്ക് ചില പ്രത്യേക വിലകള്‍ കൊടുത്തിരിക്കുന്നു 3175 = CAGE ആയാല്‍ 2125 ഏതിനെ കുറിക്കുന്നു', 1, 2, -1, -1, -1, '', 'BARE*BABE*BABY*BASE', 'BABE', '2', 1, '', 1, -1, 1, 1, -1, 12, NULL),
(21, 'തുമ്പ റോക്കറ്റ് ലോഞ്ചിംഗ് സ്റ്റേഷന്‍ പ്രവര്‍ത്തനം ആരംഭിച്ച വര്‍ഷം....ആണ്:', 1, 1, -1, -1, -1, '', '1965*1962*1963*1968', '1963', '3', 1, '', 1, -1, 1, 1, -1, 47, NULL),
(22, 'a യുടെ b% = c യുടെ d% ആയാല്‍ a:c = .......', 1, 2, -1, -1, -1, '', '100b:d*b:d*d:b*b:100d', 'b:d', '2', 1, '', 1, -1, 1, 1, -1, 10, NULL),
(23, 'ആദ്യത്തെ മലയാള പത്രം.......ആണ്', 1, 1, -1, -1, -1, '', 'കൌമുദി*നസ്രാണിദീപിക*മനോരമ*രാജ്യസമാചാരം', 'രാജ്യസമാചാരം', '4', 1, '', 1, -1, 1, 1, -1, 50, NULL),
(24, 'ഹര്‍ഷവര്‍ദ്ധനന്‍ ഉത്തരേന്ത്യ ഭരിച്ച കാലം ........ആണ്:', 1, 1, -1, -1, -1, '', 'A.D. 4-ആം നൂറ്റാണ്ട്*A.D. 2-ആം നൂറ്റാണ്ട്*A.D. 7-ആം നൂറ്റാണ്ട്*A.D. 10-ആം നൂറ്റാണ്ട്', 'A.D. 7-ആം നൂറ്റാണ്ട്', '3', 1, '', 1, -1, 1, 1, -1, 52, NULL),
(25, 'അലക്സാണ്ടര്‍ ചക്രവര്‍ത്തിയുടെയും പോറസിന്‍റെയും സൈന്യങ്ങള്‍ ഏറ്റുമുട്ടിയത്.............നദിതീരത്തുവെച്ചാണ്', 1, 1, -1, -1, -1, '', 'സത്ലജ്*ഝലം*രവി*ഇന്‍ഡസ്', 'ഝലം', '2', 1, '', 1, -1, 1, 1, -1, 54, NULL),
(26, '2004-ലെ എഴുത്തച്ഛന്‍ പുരസ്ക്കാര ജേതാവ്............ആണ്:', 1, 1, -1, -1, -1, '', 'സച്ചിതാനന്ദന്‍*കെ.പി.അപ്പന്‍*സുകുമാര്‍ അഴീക്കോട്*എം.ടി.വാസുദേവന്‍ നായര്‍', 'സുകുമാര്‍ അഴീക്കോട്', '3', 1, '', 1, -1, 1, 1, -1, 33, NULL),
(27, '5.04 ലക്ഷത്തില്‍ എത്ര ആയിരങ്ങള്‍ ഉണ്ട്?', 1, 2, -1, -1, -1, '', '50.4*504*5040*50400', '504', '2', 1, '', 1, -1, 1, 1, -1, 2, NULL),
(28, 'ഇന്ത്യയുടെ ദേശിയ കായിക വിനോദമാണ്‌;', 1, 1, -1, -1, -1, '', 'ചെസ്സ്‌*ക്രിക്കറ്റ്*ഹോക്കി*ഫുട്ബോള്‍', 'ഹോക്കി', '3', 1, '', 1, -1, 1, 1, -1, 20, NULL),
(29, 'റോമന്‍-ഗ്രീക്ക് നാവികനായ ഹിപ്പാലസ് കൊടുങ്ങലൂരില്‍ വന്നിറങ്ങിയ വര്‍ഷം.....ആണ്:', 1, 1, -1, -1, -1, '', 'A.D.68*A.D.55*B.C.52*A.D.45', 'A.D.45', '4', 1, '', 1, -1, 1, 1, -1, 46, NULL),
(30, 'ആര്യഭടന്‍ പ്രശസ്തനായ .........ആയിരുന്നു.', 1, 1, -1, -1, -1, '', 'ജ്യോതിശാസ്ത്രജ്ഞനും ഗണിതശാസ്ത്രജ്ഞനും*ഗുപ്തരാജാവ്*രാജ്യതന്ത്രജ്ഞന്‍*കവി', 'ജ്യോതിശാസ്ത്രജ്ഞനും ഗണിതശാസ്ത്രജ്ഞനും', '1', 1, '', 1, -1, 1, 1, -1, 55, NULL),
