(255, 'അഞ്ചുകുട്ടികള്‍ ഒരു വരിയായി കുന്നുകയറുകയാണ്. ജയന്ത് ഹരിയുടെ തൊട്ടു പിന്നിലാണ്.  രാമന്‍ ഗോവിന്ദന്‍റെ തൊട്ടു മുന്‍പിലാണ്. കൃഷ്ണന്‍ ഗോവിന്ദന്‍റെയും ഹരിയുടെയും ഇടയിലാണ്. ആരാണ് മുന്‍പില്‍ നിന്ന് രണ്ടാമത് നില്‍ക്കുനത്?', 1, 2, -1, -1, -1, '', 'കൃഷ്ണന്‍*ഹരി*ഗോവിന്ദന്‍*രാമന്‍', 'ഗോവിന്ദന്‍', '3', 3, '', 1, -1, 1, 1, -1, 9, NULL),
