(400, 'തര്‍ജ്ജമ ചെയ്യുക Fools rush in where angels fear to tread.', 1, 6, -1, -1, -1, '', 'മാലാഖമാരെ ഭയന്ന്‍ ചെകുത്താന്മാര്‍ ഓടുന്നു*മാലാഖമാര്‍ ഭയക്കുന്നിടത്ത് ചെകുത്താന്മാര്‍ ഇരച്ച് കയറുന്നു*മാലാഖമാരെ ഭയപ്പെടുത്തി ചെകുത്താന്‍ ഓടിക്കയറുന്നു*മാലാഖമാരെ പുറംതള്ളി ചെകുത്താന്മാര്‍ എത്തുന്നു', 'മാലാഖമാര്‍ ഭയക്കുന്നിടത്ത് ചെകുത്താന്മാര്‍ ഇരച്ച് കയറുന്നു', '2', 6, '', 1, -1, 1, 1, -1, 88, NULL),
