(5082, 'വൈദ്യുതി വിതരണം ചെയ്യുമ്പോൾ വോൾട്ടേജ് വ്യത്യാസപ്പെടുത്താൻ ഉപയോഗിക്കുന്ന ഉപകരണം ?', 1, 1, -1, -1, -1, '', 'ഗാൽവനോമീറ്റർ *ട്രാൻസ്‌ഫോമർ *കപ്പാസിറ്റർ *സ്‌റ്റെബിലൈസർ', 'ട്രാൻസ്‌ഫോമർ', '2', 57, '', 1, -1, 1, 1, -1, 22, NULL),
(5083, 'താഴെ കൊടുത്തിരിക്കുന്നവയിൽ ഭരണഘടന അനുശാസിക്കുന്ന മൗലിക ചുമതലകളുടെ കൂട്ടത്തിൽ ഉൾപ്പെടാത്തത് ഏത് ?', 1, 1, -1, -1, -1, '', 'ഭരണഘടനയെ അനുസരിക്കുക *മതസമുദായ നേതാക്കന്മാരെ ആദരിക്കുക*ദേശീയ പതാകയെയും ദേശീയ ഗാനത്തെയും ആദരിക്കുക *ഇന്ത്യയുടെ മഹത്തായ സാംസ്‌ക്കാരിക പൈതൃകത്തെ ബഹുമാനിക്കുക', 'മതസമുദായ നേതാക്കന്മാരെ ആദരിക്കുക', '2', 57, '', 1, -1, 1, 1, -1, 68, NULL),
