(5085, 'താഴെ തന്നിരിക്കുന്നവയിൽ ഗ്രാമപഞ്ചായത്തിന്‍റെ ചുമതലയിൽ ഉൾപ്പെടാത്തത് ഏത് ?', 1, 1, -1, -1, -1, '', 'ഭക്ഷ്യ വിൽപ്പന സ്ഥാപനങ്ങളുടെ ലൈസൻസ് നൽകൽ*കശാപ്പുശാലകളുടെ നടത്തിപ്പ് *മേളകളഉം ഉത്സവങ്ങളും നിയന്ത്രിക്കുക*സാക്ഷരതാ പ്രവർത്തനങ്ങളുടെ നിയന്ത്രണവും കോ-ഓർഡിനേഷനും', 'സാക്ഷരതാ പ്രവർത്തനങ്ങളുടെ നിയന്ത്രണവും കോ-ഓർഡിനേഷനും', '4', 57, '', 1, -1, 1, 1, -1, 98, NULL),
(5086, 'പ്രാഥമിക വർണങ്ങൾ ഏതെല്ലാം?', 1, 1, -1, -1, -1, '', 'മഞ്ഞ, പച്ച, നീല *ചുവപ്പ്, പച്ച, നീല *ചുവപ്പ്, മഞ്ഞ, പച്ച *മഞ്ഞ, നീല, ചുവപ്പ്', 'ചുവപ്പ്, പച്ച, നീല', '2', 57, '', 1, -1, 1, 1, -1, 75, NULL),
