(5097, 'ഒരു കാർ ആദ്യത്തെ 4 മണിക്കൂർ 60 കിലോ മീറ്റർ വേഗതയിലും അടുത്ത 4 മണിക്കുർ 80 കിലോ മീറ്റർ വേഗതയിലും അവസാനത്തെ 2 മണിക്കുർ 40 കിലോ മീറ്റർ വേഗതയിലും സഞ്ചരിച്ചു. എന്നാൽ കാറിന്‍റെ ശരാശരി വേഗത?', 1, 2, -1, -1, -1, '', '75 കിലോമീറ്റർ*64 കിലോമീറ്റർ*56 കിലോമീറ്റർ*60 കിലോമീറ്റർ', '64 കിലോമീറ്റർ', '2', 57, '', 1, -1, 1, 1, -1, 64, NULL),
(5098, '''മാറ്റുവിൻ ചട്ടങ്ങളെ സ്വയമല്ലെങ്കിൽ മാറ്റു -   മതുകളിനി നിങ്ങളെത്താൻ ''.   ഇത് ആരുടെ വരികളാണ് ?', 1, 1, -1, -1, -1, '', 'ചങ്ങമ്പുഴ*വളളത്തോൾ*കുമാരനാശാൻ*ഉളളൂർ', 'കുമാരനാശാൻ', '3', 57, '', 1, -1, 1, 1, -1, 58, NULL),
(5099, 'ഡിസംബർ 2-ാം തീയതി ഞായറാഴ്ച ആയാൽ അതേ മാസം 28-ാം തീയതി എന്താഴ്ചയായിരിക്കും ?', 1, 1, -1, -1, -1, '', 'വ്യാഴാഴ്ച *ചൊവ്വാഴ്ച *ശനിയാഴ്ച *വെളളിയാഴ്ച', 'വെളളിയാഴ്ച', '4', 57, '', 1, -1, 1, 1, -1, 43, NULL),
(5100, 'മാർബിളിന്‍റെ രാസനാമം ?', 1, 1, -1, -1, -1, '', 'കാൽസ്യം ഓക്‌സൈഡ് *കാൽസ്യം കാർബണേറ്റ് *സോഡിയം കാർബണേറ്റ് *കാൽസ്യം ബൈ കാർബണേറ്റ്', 'കാൽസ്യം കാർബണേറ്റ്', '2', 57, '', 1, -1, 1, 1, -1, 90, NULL),
(5101, 'താഴെ തന്നിരിക്കുന്നത് ത്രികോണത്തിന്‍റെ വശങ്ങളുടെ അളവുകളാണ്. ഇതിൽ മട്ട ത്രികോണം ഏത് ?', 1, 2, -1, -1, -1, '', '5, 4, 3 *6, 5, 5 *5, 5, 5 *4, 3, 2', '5, 4, 3', '1', 57, '', 1, -1, 1, 1, -1, 79, NULL),
(5102, '500 രൂപക്ക് 2 വർഷം കൊണ്ട് 100 രൂപ പലിശ ലഭിച്ചാൽ പലിശ നിരക്ക് എത്ര ശതമാനം ?', 1, 2, -1, -1, -1, '', '5% *10% *20% *9.5%', '10%', '2', 57, '', 1, -1, 1, 1, -1, 24, NULL),
(5103, 'രവീന്ദ്രനാഥടാഗോർ രചിച്ച ജനഗണമന എന്നു തുടങ്ങുന്ന ഗാനം ദേശീയ ഗാനമായി അംഗീകരിച്ച വർഷം ?', 1, 1, -1, -1, -1, '', '1950 ജനുവരി 26 *1930 ജനുവരി 26 *1947 ആഗസ്ത് 15 *1950 ജനുവരി 24', '1950 ജനുവരി 24', '4', 57, '', 1, -1, 1, 1, -1, 18, NULL),
(5104, 'മിന്നലിൽനിന്നും രക്ഷപ്പെടുന്നതിനുളള ചില നിർദേശങ്ങളാണ് താഴെ തന്നിരിക്കുന്നത്. ഇതിൽ യോജിക്കാത്തത് ഏത് ?', 1, 1, -1, -1, -1, '', 'ഒറ്റക്ക് നിൽക്കുന്ന മരത്തിന്‍റെ ചുവട്ടിൽ നിൽക്കരുത്.*പൊക്കം കൂടിയ മരത്തിന്‍റെ ചുവട്ടിൽ അഭയം പ്രാപിക്കണം*തുറസ്സായ സ്ഥലത്തു നിൽക്കുന്നയാൾ തറയിൽ പറ്റിച്ചേർന്നു കിടക്കണം.*മുറിയിൽ നിൽക്കുന്ന ആൾ അതിന്‍റെ മധ്യ ഭാഗത്തു നിൽക്കണം.', 'പൊക്കം കൂടിയ മരത്തിന്‍റെ ചുവട്ടിൽ അഭയം പ്രാപിക്കണം', '2', 57, '', 1, -1, 1, 1, -1, 31, NULL),
(5105, 'Engineering question for test purposes only', 5, -1, -1, -1, -1, '', '1*2*3*4', '3', '3', -1, '', 1, -1, -1, -1, -1, 0, '2013-10-22 18:14:28');
