(5418, 'A serious problem that has started to plague us recently is the changing value system in our society.ഇതിന്‍റെ തര്‍ജ്ജമ.', 1, 6, -1, -1, -1, '', 'വിലയിടിവും പകര്‍ച്ചവ്യാധിയുമാണ് അടുത്തകാലത്ത്മ്  നമ്മെ ബാധിച്ചിരുന്ന ഗുരുതരമായ പ്രശ്നങ്ങള്‍*സമൂഹത്തില്‍ മാറിവരുന്ന മൂല്യവ്യവസ്ഥകള്‍ ആണ് അടുത്ത കാലത്തായി  നമ്മെ ബാധിച്ചുകൊണ്ടിരിക്കുന്ന ഗുരുതരമായ പ്രശ്ന൦*ഒരു ഗുരുതരമായ പ്രശ്ന൦ സമാരംഭിച്ചു കഴിഞ്ഞു അത് മാറുന്ന വില നിലവാരമാണ്*മാറുന്ന മൂല്യവ്യവസ്ഥകള്‍ ആണ് നമ്മെ ബാധിച്ചിരിക്കുന്നത്', ' സമൂഹത്തില്‍ മാറിവരുന്ന മൂല്യവ്യവസ്ഥകള്‍ ആണ് അടുത്ത കാലത്തായി  നമ്മെ ബാധിച്ചുകൊണ്ടിരിക്കുന്ന ഗുരുതരമായ പ്രശ്ന൦', '2', 58, '', 2, 0, 1, 0, '', 94),
